import React from 'react';
import cssClasses from './home.module.scss'
import Link from 'next/link'
import styled, {css} from 'styled-components'
import NavLink from '../Components/NavLink/NavLink'
import {MyLink, MyButton} from '../Components/StyledComponents/styledComponents'

const RedLink = styled.a`
  color: red;
  text-decoration: none;
`

const Testing = styled.a`
color: red;
${(props) =>
  props.primary && css`
    {color: green;}
  `}
`;

const App = () => {
    return <div className={cssClasses.Joblers}>
        <h1 className={cssClasses.Joblers__title}>Hello NextJs</h1>
        <Link href="/docs/1" passHref>
            <RedLink>Docs</RedLink>
        </Link>
        <Link href={{pathname: "/about", query: {name: "test"}}}>
            <a>About us</a>
        </Link>
        <NavLink>About us (custom)</NavLink>
        <MyLink primary>About us (Styled)</MyLink>
        <Testing primary>Testing with styled props</Testing>
        <MyButton>Fucking button</MyButton>

    </div>
}

export default App;
